public class MemberofParliament  implements Serializable{

    private String first_name;
    private String last_name;
    private String education_details;
    private String state;
    private String party;
    private String email;

    private String constituency;
    private double Expenditure_incurred,Amount_available_with_interest,Unspent_balance, total;



    public String getFirst_name() {
        return first_name;
    }

    public void setFirst_name(String first_name) {
        this.first_name = first_name;
    }

    public String getLast_name() {
        return last_name;
    }

    public void setLast_name(String last_name) {
        this.last_name = last_name;
    }

    public String getEducation_details() {
        return education_details;
    }

    public void setEducation_details(String education_details) {
        this.education_details = education_details;
    }

    public String getState() {
        return state;
    }

    public void setState(String state) {
        this.state = state;
    }

    public String getParty() {
        return party;
    }

    public void setParty(String party) {
        this.party = party;
    }

    public String getEmail() {
        return email;
    }

    public void setEmail(String email) {
        this.email = email;
    }

    public double getExpenditure_incurred() {
        return Expenditure_incurred;
    }

    public void setExpenditure_incurred(double expenditure_incurred) {
        Expenditure_incurred = expenditure_incurred;
    }

    public double getUnspent_balance() {
        return Unspent_balance;
    }

    public void setUnspent_balance(double unspent_balance) {
        Unspent_balance = unspent_balance;
    }

    public double getTotal() {
        return total;
    }

    public void setTotal(double total) {
        this.total = total;
        this.Amount_available_with_interest = total;
    }


    public String getConstituency() {
        return constituency;
    }

    public void setConstituency(String constituency) {
        this.constituency = constituency;
    }


    // amount available with interest is total amount

}
